import React from "react";

function Cards(props){
    return(
        <>
    <div>
        <h4> {props.id} </h4>
        <p>Name:{props.name} </p>
        <p>EmailId:{props.email} </p>

        <p>Phone_No:{props.mobile_No} </p>
        <p>Password:{props.password} </p>
        <p>Id:{props.id} </p>



    </div>
    </>
    );
}
export default Cards;
